// src/pages/Login.js
import React, { useState } from "react";

export default function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    // quick debug: alert + console so you know it's working
    console.log("Login details:", { email, password });
    alert(`Login submitted\nEmail: ${email}\nPassword: ${password}`);
    // later: send to backend via axios/API
  };

  return (
    <div className="d-flex justify-content-center align-items-start" style={{ minHeight: "70vh", paddingTop: "3rem" }}>
      <div className="card p-4" style={{ width: 360 }}>
        <h3 className="card-title text-center mb-3">Login</h3>
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label htmlFor="email" className="form-label">Email address</label>
            <input
              id="email"
              type="email"
              className="form-control"
              placeholder="name@example.com"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              autoComplete="username"
            />
          </div>

          <div className="mb-3">
            <label htmlFor="password" className="form-label">Password</label>
            <input
              id="password"
              type="password"
              className="form-control"
              placeholder="Enter password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              autoComplete="current-password"
            />
          </div>

          <button type="submit" className="btn btn-primary w-100">Login</button>
        </form>
      </div>
    </div>
  );
}
